const GamePage = ({ onChangePage }) => {
  const onClickBackToHome = () => {
    onChangePage && onChangePage("app");
  };
  return (
    <div>
      <div>This is game Page!!!</div>
      <button onClick={onClickBackToHome}>Back To HomePage</button>
    </div>
  );
};

export default GamePage;
